import React, { Component } from 'react'
import "./Navbar.css"

export default class Navbar extends Component {
  render() {
    return (
      <div>
        <nav className='NavbarItems'>
            <img src='logo.jpg' alt='Logo'/>
            <h1 className='navbar-logo'>Delight Kindergarten High School</h1>

        </nav>
      </div>
    )
  }
}
